B.x5=new A.N('{ "items" : [\n    {"type" : 2, "content" : "\u9663\u5217\u8cc7\u6599\u7d50\u69cb\uff0c\u904b\u7528\u8ff4\u5708\u8dd1\u904d\u9663\u5217\u7684\u6bcf\u500b\u7d22\u5f15\u503c\uff0c\u5c31\u80fd\u4ee5\u7c21\u77ed\u7684\u7a0b\u5f0f\u78bc\u9032\u884c\u5927\u91cf\u7684\u8a08\u7b97\u3002"},\n    {"type" : 1, "content" : "\u4f8b\u5982\u4e0b\u65b9\u51fd\u5f0f sum()\uff0c\u8f38\u5165\u4e00\u500b\u6578\u503c\u9663\u5217 x\uff0c\u7528\u4e00\u500b\u8ff4\u5708\u5373\u53ef\u5c07\u9663\u5217\u5168\u90e8\u5143\u7d20\u52a0\u7e3d\uff1a"},\n    {"type" : 3, "content" : "1"},\n    {"type" : 1, "content" : "          function sum( x ) {"},\n    {"type" : 3, "content" : "1"},\n    {"type" : 1, "content" : "              let total = 0; // \u7e3d\u548c"},\n    {"type" : 3, "content" : "1"},\n    {"type" : 1, "content" : "              for (let n = 0; n < x.length; n = n +1) { // \u5f9e\u9663\u5217\u7684\u7d22\u5f15 0 \u76f4\u5230\u6700\u5f8c\u4e00\u500b\u7d22\u5f15"},\n    {"type" : 3, "content" : "1"},\n    {"type" : 1, "content" : "                  total = total + x[n];  // \u52a0\u7e3d\u9663\u5217\u5143\u7d20"},\n    {"type" : 3, "content" : "1"},\n    {"type" : 1, "content" : "              }"},\n    {"type" : 3, "content" : "1"},\n    {"type" : 1, "content" : "              return total;"},\n    {"type" : 3, "content" : "1"},\n    {"type" : 1, "content" : "          }"},\n    {"type" : 3, "content" : "2"},\n    {"type" : 1, "content" : "\u518d\u4f8b\u5982\u4e0b\u65b9\u51fd\u5f0f max()\uff0c\u8f38\u5165\u4e00\u500b\u6578\u503c\u9663\u5217 x\uff0c\u7528\u4e00\u500b\u8ff4\u5708\u5373\u53ef\u627e\u5230\u9663\u5217\u4e2d\u7684\u6700\u5927\u503c\uff1a"},\n    {"type" : 3, "content" : "1"},\n    {"type" : 1, "content" : "          function max( x ) {"},\n    {"type" : 3, "content" : "1"},\n    {"type" : 1, "content" : "              let v = Number.NEGATIVE_INFINITY; // \u5148\u8a2d\u5b9a v \u70ba\u8ca0\u7121\u9650\u5927"},\n    {"type" : 3, "content" : "1"},\n    {"type" : 1, "content" : "              for (let n = 0; n < x.length; n = n +1) { // \u5f9e\u9663\u5217\u7684\u7d22\u5f15 0 \u76f4\u5230\u6700\u5f8c\u4e00\u500b\u7d22\u5f15"},\n    {"type" : 3, "content" : "1"},\n    {"type" : 1, "content" : "                  v = ( x[n] > v ? x[n] : v ); // \u5c07 x[n] \u8207 v \u6bd4\u8f03\uff0c\u5927\u8005\u8a2d\u5b9a\u7d66 v"},\n    {"type" : 3, "content" : "1"},\n    {"type" : 1, "content" : "              }"},\n    {"type" : 3, "content" : "1"},\n    {"type" : 1, "content" : "              return v;"},\n    {"type" : 3, "content" : "1"},\n    {"type" : 1, "content" : "          }"},\n    {"type" : 3, "content" : "2"},\n    {"type" : 1, "content" : "\u5728\u4e0a\u65b9\u7684\u7bc4\u4f8b\u4e2d\uff0c\u7121\u8ad6\u50b3\u5165\u51fd\u5f0f\u7684\u9663\u5217 x \u6709\u5343\u500b\u6216\u842c\u500b\u5143\u7d20\uff0c\u7a0b\u5f0f\u78bc\u90fd\u7121\u9808\u66f4\u8b8a\u3002\u904b\u7528\u8ff4\u5708\u642d\u914d\u9663\u5217\u8cc7\u6599\u7d50\u69cb\uff0c\u78ba\u5be6\u80fd\u4ee5\u7c21\u77ed\u7684\u7a0b\u5f0f\u78bc\u8655\u7406\u5927\u91cf\u8cc7\u6599\u3002"}]}',null)
B.x6=new A.N('{ "items" : [\n    {"type" : 1, "content" : "\u5728\u9019\u4e00\u7bc0\u7684\u8ab2\u7a0b\u88e1\uff0c\u6211\u5011\u8a8d\u8b58\u589e\u52a0\u8207\u522a\u9664\u9663\u5217\u5143\u7d20\u7684\u65b9\u6cd5\uff0c\u4ee5\u53ca\u904b\u7528\u9663\u5217\u6a21\u64ec\u5169\u7a2e\u8cc7\u6599\u7d50\u69cb\uff1a\u5806\u758a (Stack) \u8207\u4f47\u5217 (Queue)\u3002\u5806\u758a\u5c31\u662f\u5f8c\u9032\u5148\u51fa\uff0c\u8cc7\u6599\u4ee5\u5806\u758a\u7684\u672b\u7aef\u70ba\u552f\u4e00\u51fa\u5165\u53e3\u9032\u51fa\uff0c\u4f47\u5217\u5c31\u662f\u5148\u9032\u5148\u51fa\uff0c\u8cc7\u6599\u5f9e\u4f47\u5217\u7684\u672b\u7aef\u9032\u3001\u524d\u7aef\u51fa\u3002\u53ef\u4ee5\u7528\u9663\u5217\u642d\u914d\u9663\u5217\u7684\u65b9\u6cd5\uff0c\u6a21\u64ec\u5806\u758a\u8207\u4f47\u5217\u9019\u5169\u7a2e\u8cc7\u6599\u7d50\u69cb\u3002"}]}',null)
B.x7=new A.N('{ "items" : [\n    {"type" : 1, "content" : "\u5728\u9019\u4e00\u7bc0\u7684\u8ab2\u7a0b\u88e1\uff0c\u6211\u5011\u8a8d\u8b58\u4e86\u55ae\u5f15\u865f\u5b57\u4e32\u8207\u96d9\u5f15\u865f\u5b57\u4e32\uff0c\u4f7f\u7528\u8f49\u7fa9\u5e8f\u5217\u5728\u5b57\u4e32\u4e2d\u8868\u9054\u63db\u884c\u8207\u5404\u7a2e\u5f15\u865f\uff0c\u4e5f\u5b78\u5230\u4f7f\u7528\u6a23\u677f\u5b57\u4e32\uff0c\u5728\u53cd\u5f15\u865f\u7576\u4e2d\u4f7f\u7528\u5d4c\u5165\u683c\u5f0f ${ }\uff0c\u5373\u53ef\u5728\u5b57\u4e32\u4e2d\u5d4c\u5165\u8b8a\u6578\u3002"}]}',null)
B.x8=new A.N('{ "items" : [\n    {"type" : 1, "content" : "\u5728\u904e\u53bb\u7684\u8ab2\u7a0b\u88e1\uff0c\u6211\u5011\u5df2\u7d93\u8a8d\u8b58\u6578\u503c\u9019\u7a2e\u8cc7\u6599\u3002\u5728\u5b78\u7fd2\u4e86\u7269\u4ef6\u7684\u89c0\u5ff5\u4e4b\u5f8c\uff0c\u6211\u5011\u8981\u8a8d\u8b58 "},\n    {"type" : 2, "content" : "JavaScript \u5c07\u6578\u503c\u5305\u88dd\u6210\u6578\u503c\u7269\u4ef6\u3002"},\n    {"type" : 1, "content" : "\u4e5f\u5c31\u662f\u5728\u7a0b\u5f0f\u8a9e\u6cd5\u4e0a\u4e0d\u9700\u8981\u4f7f\u7528 new Number() \u5efa\u7acb\u6578\u503c\u985e\u5225\u7269\u4ef6\uff0c\u800c\u662f\u53ef\u4ee5\u76f4\u63a5\u6307\u6d3e\u6578\u503c\u5167\u5bb9\u7d66\u8b8a\u6578\uff0c\u4f8b\u5982 x = 123\uff0c"},\n    {"type" : 2, "content" : "JavaScript \u5c31\u6703\u8b93\u8b8a\u6578\u53ef\u4ee5\u4f7f\u7528\u6578\u503c\u7269\u4ef6\u7684\u5c6c\u6027\u8207\u65b9\u6cd5\u3002JavaScript \u7279\u5225\u512a\u5316\u6578\u503c\u7684\u57f7\u884c\u6548\u80fd\uff0c\u6240\u4ee5\u6578\u503c\u7684\u6548\u80fd\u512a\u65bc\u6578\u503c\u7269\u4ef6\u7684\u6548\u80fd\u3002\u8acb\u4f7f\u7528\u6578\u503c\uff0c\u907f\u514d\u5efa\u7acb\u6578\u503c\u7269\u4ef6\u3002"}]}',null)
B.x9=new A.N('{ "items" : [\n    {"type" : 1, "content" : "\u5728\u9019\u4e00\u7bc0\u7684\u8ab2\u7a0b\u88e1\uff0c\u6211\u5011\u8a8d\u8b58\u63d0\u5347\u8655\u7406\u8cc7\u6599\u66f4\u6709\u6548\u7387\u7684\u904b\u7b97\u601d\u7dad\uff0c\u8cc7\u6599\u7d50\u69cb\u53ef\u4ee5\u8b93\u904b\u7b97\u6548\u80fd\u500d\u589e\uff0c\u518d\u642d\u914d\u5408\u9069\u7684\u6f14\u7b97\u6cd5\u80fd\u8b93\u904b\u7b97\u6548\u80fd\u66f4\u52a0\u63d0\u5347\u3002\u4e5f\u5b78\u7fd2\u4e86\u9663\u5217\u8cc7\u6599\u7d50\u69cb\uff0c\u4ee5\u53ca JavaScript \u5ba3\u544a\u8207\u4f7f\u7528\u9663\u5217\u7684\u8a9e\u6cd5\u3002\u900f\u904e\u9663\u5217\uff0c\u8b93\u4e00\u500b\u8b8a\u6578\u53ef\u4ee5\u5132\u5b58\u5927\u91cf\u7684\u8cc7\u6599\uff0c\u518d\u642d\u914d\u8ff4\u5708\u8a08\u7b97\uff0c\u5373\u53ef\u7528\u5c11\u8a31\u7684\u7a0b\u5f0f\u78bc\u8655\u7406\u5927\u91cf\u7684\u8cc7\u6599\u3002"}]}',null)
B.xa=new A.N('{ "items" : [\n    {"type" : 1, "content" : "\u7a0b\u5f0f\u5c31\u662f\u7d66\u96fb\u8166\u57f7\u884c\u7684\u6d41\u7a0b\uff0c\u7a0b\u5f0f\u8a2d\u8a08\u5c31\u662f\u8a2d\u8a08\u6d41\u7a0b\u7d66\u96fb\u8166\u57f7\u884c\u3002\u65e9\u671f\u7684\u7a0b\u5f0f\u8a9e\u8a00\u6c92\u6709\u7d50\u69cb\u7684\u6982\u5ff5\uff0c\u8b93\u96fb\u8166\u5728\u9019\u88e1\u57f7\u884c\u5e7e\u500b\u547d\u4ee4\uff0c\u5c31\u8df3\u5230\u53e6\u4e00\u908a\u53bb\u57f7\u884c\u547d\u4ee4\u3002\u7a0b\u5f0f\u662f\u5beb\u7d66\u96fb\u8166\u770b\u7684\uff0c\u6240\u4ee5\u5373\u4fbf\u57f7\u884c\u9806\u5e8f\u8df3\u4f86\u8df3\u53bb\uff0c\u53ea\u8981\u96fb\u8166\u80fd\u6b63\u78ba\u5de5\u4f5c\u5c31\u597d\u3002\u7136\u800c\uff0c\u7576\u6240\u64b0\u5beb\u7684\u7a0b\u5f0f\u8d8a\u4f86\u8d8a\u9f90\u5927\u6642\uff0c\u4eba\u8166\u7121\u6cd5\u7406\u89e3\u7a0b\u5f0f\u78bc\u7684\u904b\u884c\u908f\u8f2f\u3002\u9019\u6642\u5019\uff0c\u8a95\u751f\u4e86"},\n    {"type" : 2, "content" : "\u7d50\u69cb\u5316\u7a0b\u5f0f\u8a2d\u8a08\uff0c\u8b93\u4eba\u5bb9\u6613\u95b1\u8b80\u8207\u7406\u89e3\u7a0b\u5f0f\u78bc\u3002"},\n    {"type" : 3, "content" : "2"},\n    {"type" : 2, "content" : "\u7d50\u69cb\u5316\u7a0b\u5f0f\u8a2d\u8a08\uff0c\u5c31\u662f\u904b\u7528\u5faa\u5e8f\u7d50\u69cb\u3001\u9078\u64c7\u7d50\u69cb\u3001\u91cd\u8907\u7d50\u69cb\u4f86\u8a2d\u8a08\u7a0b\u5f0f\u3002"},\n    {"type" : 1, "content" : "\u7a0b\u5f0f\u6d41\u7a0b\u7531\u4e0a\u5230\u4e0b\u4e0d\u6703\u4e82\u8df3\u9806\u5e8f\uff0c\u5c31\u662f\u5faa\u5e8f\u7d50\u69cb\u3002if \u8207 switch \u6307\u4ee4\u7684\u7a0b\u5f0f\u5340\u584a\u5c31\u662f\u9078\u64c7\u7d50\u69cb\uff0c\u4f9d\u689d\u4ef6\u7684\u4e0d\u540c\u800c\u9078\u64c7\u57f7\u884c\u4e0d\u540c\u7684\u6d41\u7a0b\u3002for \u8207 while \u6307\u4ee4\u7684\u7a0b\u5f0f\u5340\u584a\u5c31\u662f\u91cd\u8907\u7d50\u69cb\uff0c\u91cd\u8907\u57f7\u884c\u6d41\u7a0b\u76f4\u5230\u7b26\u5408\u7d50\u675f\u8ff4\u5708\u7684\u689d\u4ef6\u3002"},\n    {"type" : 3, "content" : "2"},\n    {"type" : 1, "content" : "\u7d50\u69cb\u5316\u7a0b\u5f0f\u8a2d\u8a08\u8b93\u7a0b\u5f0f\u78bc\u5bb9\u6613\u95b1\u8b80\u8207\u7406\u89e3\uff0c\u7136\u800c\uff0c\u7576\u6240\u64b0\u5beb\u7684\u7a0b\u5f0f\u8d8a\u4f86\u8d8a\u5927\u4e14\u8907\u96dc\u6642\uff0c\u53ef\u80fd\u5728\u7a0b\u5f0f\u7684\u4e0d\u540c\u90e8\u5206\u9700\u8981\u76f8\u540c\u7684\u529f\u80fd\uff0c\u537b\u82b1\u8cbb\u6642\u9593\u53bb\u64b0\u5beb\u91cd\u8907\u7684\u7a0b\u5f0f\u78bc\uff0c\u5982\u679c\u9084\u4e0d\u5c0f\u5fc3\u5beb\u932f\uff0c\u5c31\u9020\u6210\u6642\u9593\u8207\u4eba\u529b\u7684\u6d6a\u8cbb\u3002"},\n    {"type" : 2, "content" : "\u70ba\u4e86\u63d0\u6607\u7a0b\u5f0f\u8a2d\u8a08\u7684\u6548\u7387\u4e26\u6e1b\u5c11\u8a2d\u8a08\u932f\u8aa4\uff0c\u8a95\u751f\u4e86\u6a21\u7d44\u5316\u7a0b\u5f0f\u8a2d\u8a08\u3002"},\n    {"type" : 3, "content" : "2"},\n    {"type" : 2, "content" : "\u6a21\u7d44\u5316\u7a0b\u5f0f\u8a2d\u8a08\uff0c\u5c31\u662f\u5c07\u5927\u7684\u5b8c\u6574\u7a0b\u5f0f\uff0c\u5207\u5206\u6210\u591a\u500b\u5c0f\u7684\u6a21\u7d44\uff0c\u500b\u5225\u5b8c\u6210\u5c0f\u6a21\u7d44\u518d\u7d44\u5408\u6210\u5b8c\u6574\u7684\u7a0b\u5f0f\u3002"},\n    {"type" : 1, "content" : "\u4f7f\u7528 function \u6307\u4ee4\u5b9a\u7fa9\u51fd\u5f0f\uff0c\u5c31\u662f\u6a21\u7d44\u5316\u7a0b\u5f0f\u8a2d\u8a08\u7684\u6982\u5ff5\u3002\u5c07\u5927\u7684\u5b8c\u6574\u7a0b\u5f0f\u5207\u5206\u6210\u591a\u500b\u51fd\u5f0f\uff0c\u76e1\u91cf\u91cd\u8907\u4f7f\u7528\u5df2\u6709\u7684\u51fd\u5f0f\uff0c\u5c31\u80fd\u6e1b\u5c11\u91cd\u8907\u64b0\u5beb\u76f8\u540c\u7a0b\u5f0f\u529f\u80fd\u7684\u6d6a\u8cbb\u3002\u4e26\u4e14\uff0c\u7531\u65bc\u4e00\u6b21\u53ea\u64b0\u5beb\u4e00\u500b\u51fd\u5f0f\u7684\u7a0b\u5f0f\u78bc\uff0c\u800c\u4e0d\u662f\u76f4\u63a5\u64b0\u5beb\u5b8c\u6574\u6240\u6709\u7684\u7a0b\u5f0f\u78bc\uff0c\u53ef\u4ee5\u5728\u64b0\u5beb\u51fd\u5f0f\u6642\u5c31\u6aa2\u67e5\u662f\u5426\u6709\u7a0b\u5f0f\u8a2d\u8a08\u932f\u8aa4\uff0c\u6e1b\u5c11\u6574\u9ad4\u7684\u8a2d\u8a08\u932f\u8aa4\u3002"},\n    {"type" : 3, "content" : "2"},\n    {"type" : 1, "content" : "\u7a0b\u5f0f\u8a2d\u8a08\u7684\u65b9\u5f0f\uff0c\u5f9e\u53ea\u8981\u80fd\u5beb\u51fa\u4f86\u8b93\u96fb\u8166\u57f7\u884c\uff0c\u6f14\u8b8a\u6210\u7d50\u69cb\u5316\u7a0b\u5f0f\u8a2d\u8a08\uff0c\u518d\u6f14\u8b8a\u6210\u6a21\u7d44\u5316\u7a0b\u5f0f\u8a2d\u8a08\u3002\u8b93\u7a0b\u5f0f\u78bc\u8d8a\u4f86\u8d8a\u9069\u5408\u4eba\u5011\u95b1\u8b80\u8207\u591a\u4eba\u5206\u5de5\u5408\u4f5c\u3002"}]}',null)
